import React from 'react'
import "./styles.css"
import Listİtem from './Listİtem';


function List({toDoList}) {
    return (
        <ul className="todo-list">
            {
                toDoList.map((text,index)=>(
                    <li>
                        <div className="view">
                            <input className="toggle" type="checkbox"></input>
                            <label>{text}</label>
                            <button className="destroy"></button>
                        </div>
                    </li>
                ))
            }
        </ul>
    )
}

export default List
